-- Table structure for table "interactions"
CREATE TABLE "interactions" (
  "interaction_id" bigserial PRIMARY KEY,
  "user_id" bigint NOT NULL,
  "product_id" bigint NOT NULL,
  "interaction_type" varchar(20) NOT NULL CHECK (interaction_type IN ('view','add_to_cart','purchase','wishlist','search','compare')),
  "timestamp" timestamp NOT NULL,
  "quantity" integer,
  "session_id" varchar(255),
  "device_type" varchar(50),
  "source_page" varchar(255),
  "search_query" varchar(500),
  "created_at" timestamp,
  "updated_at" timestamp
);

COMMENT ON TABLE "interactions" IS 'Table logging user interactions with products';
COMMENT ON COLUMN "interactions"."interaction_id" IS 'Unique identifier for each interaction';
COMMENT ON COLUMN "interactions"."user_id" IS 'Foreign key to the users table';
COMMENT ON COLUMN "interactions"."product_id" IS 'Foreign key to the products table';
COMMENT ON COLUMN "interactions"."interaction_type" IS 'Type of interaction (e.g., view, add_to_cart, purchase)';
COMMENT ON COLUMN "interactions"."timestamp" IS 'Date and time of the interaction';
COMMENT ON COLUMN "interactions"."quantity" IS 'Quantity of product involved in interaction (e.g., for add_to_cart, purchase)';
COMMENT ON COLUMN "interactions"."session_id" IS 'User session identifier';
COMMENT ON COLUMN "interactions"."device_type" IS 'Device used for interaction (e.g., desktop, mobile)';
COMMENT ON COLUMN "interactions"."source_page" IS 'Page from which the interaction occurred';
COMMENT ON COLUMN "interactions"."search_query" IS 'Search query if interaction_type is search';

