CREATE TABLE recommendation_logs (
  id bigserial PRIMARY KEY,
  recommendation_id varchar(64),
  product_id bigint,
  user_id bigint,
  displayed_at timestamp,
  session_id varchar(255)
);

COMMENT ON TABLE recommendation_logs IS 'Table for tracking product recommendation displays';

CREATE TABLE reviews (
  review_id bigserial PRIMARY KEY,
  product_id bigint NOT NULL,
  user_id bigint NOT NULL,
  rating integer NOT NULL,
  review_text text,
  timestamp timestamp NOT NULL,
  is_verified_buyer boolean NOT NULL DEFAULT false,
  created_at timestamp,
  updated_at timestamp
);

COMMENT ON TABLE reviews IS 'Table storing product reviews and ratings';
COMMENT ON COLUMN reviews.review_id IS 'Unique identifier for each review';
COMMENT ON COLUMN reviews.product_id IS 'Foreign key to the products table';
COMMENT ON COLUMN reviews.user_id IS 'Foreign key to the users table';
