  email varchar(255) NOT NULL,
  password varchar(255) NOT NULL,
  first_name varchar(100) DEFAULT NULL,
  last_name varchar(100) DEFAULT NULL,
  registration_date timestamp DEFAULT NULL,
  last_login_date timestamp DEFAULT NULL,
  medical_specialty varchar(255) DEFAULT NULL,
  practice_type varchar(100) DEFAULT NULL,
  location varchar(255) DEFAULT NULL,
  organization_name varchar(255) DEFAULT NULL,
  user_segment varchar(100) DEFAULT NULL,
  preferred_brands varchar(255) DEFAULT NULL,
  created_at timestamp DEFAULT NULL,
  updated_at timestamp DEFAULT NULL
);

COMMENT ON TABLE users IS 'Table storing user profile data';
COMMENT ON COLUMN users.user_id IS 'Unique identifier for each user';
COMMENT ON COLUMN users.email IS 'User email address (unique login identifier)';
COMMENT ON COLUMN users.first_name IS 'User''s first name';
COMMENT ON COLUMN users.last_name IS 'User''s last name';
COMMENT ON COLUMN users.registration_date IS 'Date and time of user registration';
COMMENT ON COLUMN users.last_login_date IS 'Date and time of user''s last login';
COMMENT ON COLUMN users.medical_specialty IS 'User''s medical specialty (e.g., Orthopedics, Cardiology)';
COMMENT ON COLUMN users.practice_type IS 'Type of medical practice (e.g., Hospital, Clinic, ASC)';
COMMENT ON COLUMN users.location IS 'User''s city, state, or country';
COMMENT ON COLUMN users.organization_name IS 'Name of the organization the user belongs to';
COMMENT ON COLUMN users.user_segment IS 'User segmentation for marketing or personalization';
COMMENT ON COLUMN users.preferred_brands IS 'Comma-separated list of preferred brands if specified by user';

