CREATE TABLE Orders (
    OrderID BIGSERIAL PRIMARY KEY,
    UserID BIGINT NOT NULL REFERENCES Users(user_id) ON DELETE RESTRICT,
    OrderDate TIMESTAMPTZ NOT NULL DEFAULT CURRENT_TIMESTAMP,
    OrderTotal DECIMAL(10, 2) NOT NULL CHECK (OrderTotal >= 0),
    OrderStatus VARCHAR(50) NOT NULL 
        CHECK (OrderStatus IN ('Pending', 'Processing', 'Shipped', 'Delivered', 'Cancelled', 'Refunded')),
    ShippingAddress TEXT NOT NULL,
    BillingAddress TEXT NOT NULL,
    PaymentMethod VARCHAR(100) NOT NULL,
    CreatedAt TIMESTAMPTZ NOT NULL DEFAULT CURRENT_TIMESTAMP,
    UpdatedAt TIMESTAMPTZ NOT NULL DEFAULT CURRENT_TIMESTAMP,
    
    -- Add index for frequently queried columns
    CONSTRAINT valid_order_status CHECK (OrderStatus ~ '^[A-Za-z]+$')
);

-- Create indexes for performance
CREATE INDEX idx_orders_user_id ON Orders(UserID);
CREATE INDEX idx_orders_status ON Orders(OrderStatus);
CREATE INDEX idx_orders_date ON Orders(OrderDate);

-- Add comment for documentation
COMMENT ON TABLE Orders IS 'Stores customer order information';
COMMENT ON COLUMN Orders.OrderStatus IS 'Current state of the order: Pending, Processing, Shipped, Delivered, Cancelled, or Refunded';

-- Table for items within an order
CREATE TABLE OrderItems (
    OrderItemID BIGSERIAL PRIMARY KEY,
    OrderID BIGINT NOT NULL REFERENCES Orders(OrderID) ON DELETE RESTRICT,
    ProductID BIGINT NOT NULL REFERENCES Products(Product_ID) ON DELETE RESTRICT,
    Quantity INT NOT NULL CHECK (Quantity > 0),
    PriceAtPurchase DECIMAL(10, 2) NOT NULL CHECK (PriceAtPurchase >= 0),
    DiscountAmount DECIMAL(10, 2) DEFAULT 0 CHECK (DiscountAmount >= 0),
    CreatedAt TIMESTAMPTZ NOT NULL DEFAULT CURRENT_TIMESTAMP,
    
    -- Composite unique constraint to prevent duplicate items in an order
    UNIQUE (OrderID, ProductID),
    
    -- Ensure discount doesn't exceed item price
    CHECK (DiscountAmount <= PriceAtPurchase)
);

-- Create indexes for order items
CREATE INDEX idx_order_items_order ON OrderItems(OrderID);
CREATE INDEX idx_order_items_product ON OrderItems(ProductID);

-- Add comment for documentation
COMMENT ON TABLE OrderItems IS 'Stores individual items within each order';
COMMENT ON COLUMN OrderItems.PriceAtPurchase IS 'Snapshot of product price at time of purchase';




